import './App.css';
import React, { useState, useEffect } from "react";
import Select from "react-select";

function App() {
  const [branches, setBranches] = useState("");

  useEffect(() => {
    fetch("http://localhost:8000/branches")
      .then((res) => res.json())
      .then((data) => 
        {
          setBranches(
            data.map((branch) => (

                  <option value="{branch.BranchNum}">{branch.BranchName}</option>

            )));
        }
      );
  }, []);

  return (
    <div className="App">
      <header className="App-header">
      <h1>Video4Ever Branch Inventory</h1>
        <p>
         Choose a branch to view the branch inventory.
        </p>
        <Select options={branches} />
      </header>
    </div>
  );
}

export default App;
